import React from 'react'
import Header from './Header'
import UserInfo from './UserInfo'
import '../App.css';

const data = [
  {
    name: "Tal",
    age: 23,
    gender: "Male"
  },
  {
    name: "Miri",
    age: 31,
    gender: "Female"
  },
  {
    name: "Nadia",
    age: 27,
    gender: "Female"
  }
]


function App() {
  return (
    <div className="App">
      <Header />

      {data.map(user=>{
        return(
          <UserInfo 
            name={user.name}
            age={user.age}
            gender={user.gender}
         />
        );
      })}
    </div>
  );
}

export default App;
